package cn.finder.wae.api.sdk.domain;import cn.finder.httpcommons.ApiObject;/**** API-流程-任务列表返回数据*/public class Task extends ApiObject{	private	String	id;	private	String	name;	private	String	userId;	private	String	procDefName;	private	String	businessKey;	private	String	taskDefKey;	private String 	p_user_id;	private String  assignee;		public String getP_user_id() {		return p_user_id;	}	public void setP_user_id(String p_user_id) {		this.p_user_id = p_user_id;	}	public String getAssignee() {		return assignee;	}	public void setAssignee(String assignee) {		this.assignee = assignee;	}	public	String	getId()	{		return 	id;	}	public void setId(String id)	{		this.id=id;	}	public	String	getName()	{		return 	name;	}	public void setName(String name)	{		this.name=name;	}	public	String	getUserId()	{		return 	userId;	}	public void setUserId(String userId)	{		this.userId=userId;	}	public	String	getProcDefName()	{		return 	procDefName;	}	public void setProcDefName(String procDefName)	{		this.procDefName=procDefName;	}	public	String	getBusinessKey()	{		return 	businessKey;	}	public void setBusinessKey(String businessKey)	{		this.businessKey=businessKey;	}	public	String	getTaskDefKey()	{		return 	taskDefKey;	}	public void setTaskDefKey(String taskDefKey)	{		this.taskDefKey=taskDefKey;	}}